let LetCorpoDaPagina = document.getElementById("BodyDivSideBar");

type ModalEmpresaType = {
  onClose?: () => void;
};

const ModalEmpresa: FunctionComponent<ModalEmpresaType> = ({ onClose }) => {

  useEffect(() => {

  });

  return (
    <div id="Modal" className={styles.modalEmpresaDiv + " " + CssModais.TamanhoModal}>
      <button className={styles.closeButton} onClick={onClose}>
        <button className={styles.xButton} onClick={onClose}>
          X
